import React from 'react'
import products from './../products';
const HomeScreen = () => {
    return (
        <>
            <h1>Latest Products</h1>
            <div className="row">
    { products.map(el=> <div className="col">{}</div> )}
            </div>
        </>
    )
}

export default HomeScreen
